import React from 'react';

function DoctorDashboard({ user }) {
  return (
    <div className="min-h-screen bg-gradient-to-br from-blue-100 via-white to-blue-200 p-8">
      <h2 className="text-3xl font-bold text-gray-800 text-center mb-6">Doctor Dashboard</h2>
      <p>Welcome, {user.username}! Manage your treatments here.</p>
      <p><a href="/doctor-record" className="text-blue-600 hover:underline">Record Treatment</a></p>
    </div>
  );
}

export default DoctorDashboard;
